export default function CardHeader({p, title}) {

    return (
        <div className="move-card-header">
            <Halftone 
                styles="card"
                color="attacker"/>
            <div className="card-header">
                <BattleIcon />
                <p>{title}</p>
            </div>
        </div>
    )
}
